// src/pages/Admin.jsx
import React from 'react';
import { useNavigate } from 'react-router-dom';

const Admin = ({ user }) => {
  const navigate = useNavigate();

  return (
    <div className="admin-dashboard">
      <h1>Welcome Admin, {user?.prenom} {user?.nom}</h1>
      <div className="admin-actions">
        <button onClick={() => navigate('/employees')} className="btn">Manage Employees</button>
        <button onClick={() => navigate('/equipment')} className="btn">Manage Equipment</button>
        <button onClick={() => navigate('/attribution')} className="btn">Manage Attributions</button>
        <button onClick={() => navigate('/returns')} className="btn">Add Return</button>
      </div>
    </div>
  );
};

export default Admin;
